VALUES ('20680947', 'Radiatori 3 Fromages Sauce au Parmesan + 1 fondant au chocolat', 'Plat 74,2% : Mélange de pâtes alimentaires cuisinées 64,5% (pâtes alimentaires radiatori aux _œufs_ cuites 61.9% (eau, semoule de _blé_ dur de qualité supérieure, _œufs_), huile de colza, ciboulette, persil, sel, poivre blanc), Emmental 3.2% (_lait_ de vache pasteurisé, sel, ferments lactiques, présure, coagulant), fromage italien 3.2% (_lait_ de vache cru, sel, présure, conservateur: lysozyme (_œuf_), Bleu d\'Auvergne 3.2% (lait de vache pasteurisé, sel, présure, ferment lactique et d\'affinage dont Penicillium roqueforti). Sauce au Parmesan 16,1% : eau, crème stérilisée UHT 4.7% (crème (lait), stabilisant : carraghénanes), Parmesan 1.1% (lait), huile de colza, amidon modifié de maïs, poudre de lait écrémé, arôme (lait), sel, basilic 0.05%, arôme naturel, conservateur : sorbate de potassium, poivre blanc. Gâteau avec 9.6% de chocolat noir 8.1% :sucre, _œufs_, farine de _blé_, beurre pâtissier (lait), huile de colza non hydrogénée, sirop de glucose-fructose, stabilisants : sorbitols et glycérol, pâte de cacao, cacao en poudre, sel, émulsifiant : lécithines (soja). Sachet de parmesan râpé 1.6% : lait de vache cru, sel, présure de veau.', 'https://static.openfoodfacts.org/images/products/20680947/front_fr.4.400.jpg', '8.1', '4.1', '21.4', '0.6', '', '8.8', '0.19', '0.0748031496062992', '', '1');

